= Auffällige Bereiche =

== 07.03.2019 14:50 - 14:55: ==

Es macht wenig Sinn in diesem Bereich den Warnbereich auf 2 zu wechseln, da die Geschwindigkeit fast 20 km/h kleiner ist als der AVG. Die Videobilder bestätigen dies, es ist in diesem Zeitraum klar zu erkennen, dass der Verkehr sehr langsam rollt.

